import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Use a robust, user-facing selector to find and click the profile link.
    // There are multiple "Your Profile" links, so we'll click the first one available.
    const profileLink = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLink.click();

    // Wait for the profile section to be rendered dynamically by the script.
    // We'll wait for a unique element within the profile page.
    await page.waitForSelector('.profile-page .profile-header');

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract data to verify that we are on the correct profile page
    const profileName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();

    if (!profileName || !username) {
        throw new Error("Could not extract profile name or username from the page.");
    }

    return {
      success: true,
      action: "Navigated to Jun's Profile page by clicking the 'Your Profile' link.",
      extractedData: {
        profileName: profileName.trim(),
        username: username.trim(),
        bio: bio.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
